import React from "react";
import DeveloperForm from "../components/developer/DeveloperForm";

const DeveloperDashboard = () => {
  return (
    <div>
      <h1>Developer Dashboard</h1>
      <DeveloperForm />
    </div>
  );
};

export default DeveloperDashboard;
